from typing import List
from myUtils.Utils import printResult
import heapq

class Solution:
    def getSortedtasksay(self, tasks: List[List[int]]):
        arr = []
        for i, task in enumerate(tasks):
            arr.append((task, i))
        # print(arr)
        return arr
    
    def getOrder(self, tasks: List[List[int]]) -> List[int]:
        tasks = self.getSortedtasksay(tasks)
        tasks.sort()
        order = []
        heap = []
        # print(tasks)
        currTime = 1

        for (eTime, pTime), i in tasks:
            while heap and eTime > currTime:
                pT, idx = heapq.heappop(heap)
                order.append(idx)
                currTime += pT
            currTime = max(currTime, eTime)
            heapq.heappush(heap, (pTime, i))

        heap.sort()
        # print(heap)
        for _, i in heap:
            order.append(i)
        return order
    
